import React from 'react';
import * as FaIcons from 'react-icons/fa'
import { Link } from 'react-router-dom'


function CartWidget() {
    return (
        <>

            <div className="CartWidget">
                <Link to="#" className="menu-bars">
                    <FaIcons.FaBars />
                </Link>

            </div>


        </>




    )



}
